import React, { Component } from 'react';
import './App.css';

function App() {
  return (
    <div className="container mt-4">
      <h4 className="display-4 text-center mb-4">
        <i className="fab fa-react"></i>  React File Uploader
      </h4>
    </div>
  );
}

export default App;
